import React from 'react';

import Menu from './Menu';

export default function Layout({children}) {    
  return (
    <>
        <Menu />
        <div className="container">
          <div className="d-none d-lg-block text-phone text-center">
              Telefones: <br /> 87-9999-999 / 87-9999-9999
          </div>
            {children}
        </div>
    </>
  );
}
